+      {
+        path: '/',
+        element: <Home />,
+      },
+      {
+        path: '/people',
+        element: <People />,
+        children: [
+          {
+            path: ':personSlug',
+            element: <People />,
+          },
+        ],
+      },
+      {
+        path: '*',
+        element: <ErrorPage />,
+      },
+    ],
+  },
+]);
+
+createRoot(document.getElementById('root') as HTMLDivElement).render(
+  <RouterProvider router={router} />,
+);

